import data from "../../data/index.json";

export default function achivement() {
  return (
    <section className="achivement--section" id="myachivements">
      <div className="achivement--container">
        <h2 className="achivement--section--heading">My Achivements</h2>
      </div>

      <div className="achivement--section--container">
        {data?.achievements?.map((item, index) => (
          <div key={index} className="achivement--section--card">
            <div className="achivement--section--img">

            </div>
            <div className="achivement--section--card--content">
              <h3 className="achivement--section--title">{item.title}</h3>
              <p className="achivement--section--description">{item.description}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
